import React from 'react'
import '../../App.css'
import '../../Styles/News.css'
import NewsBig from './NewsBig'
import News from './News'

export default function NewsList(props) {

    const news = props.news
    const bigNews = props.bigNews
    const oldestNews = props.oldestNews 

    const cateList = []
    if (news) {
        for (let i in news) {
            cateList.push(news[i].newCate)
        }
        for (let i in cateList) {
            console.log(cateList[i])
        }
    }

    return (
        <div className="newslist">
            <div className="newslist-tab flex">
                { cateList &&
                    cateList.map((item, index) => {
                        return (
                            <div 
                                key={index}
                                className="newslist-box flex newslist-box-active">
                                {item} 
                                <div className="news-count flex-center">23</div>
                            </div>
                        )
                    })
                }
            </div>
            <div className="newslist-big flex">
                {
                    bigNews.map((item, index) => {
                        return (
                            <NewsBig
                                key={index}
                                bigNews={item}
                            />
                        )
                    })
                }
            </div>
            <div className="newslist-small flex"> 
                {
                    oldestNews.map((item, index) => {
                        return (
                            <News
                                key={index}
                                news={item}
                            />
                        )
                    })
                }
            </div>
            <div className="newslist-pag flex">

            </div>
        </div>
    )
}
